INSERT INTO `question` VALUES (1,2,1,'Desarrolla los proyectos, tareas, asignaciones buscando siempre la excelencia independientemente del reto que eso signifique?'),(2,0,1,'Se mantiene al día, retroalimentando su conocimiento a través de la búsqueda constante de nuevas ideas, tendencias, etc?'),(3,0,1,'\"Su trabajo siempre se destaca o sobresale por la calidad, la obsesión por la atención al detalle y se preocupo por que sea siempre perfecto? \"'),(4,0,1,'Su trabajo se destaca por mantener las últimas tendencias tanto en el campo de desarrollo, creativo, calidad y administrativo?'),(5,0,1,'Mantiene un buen desempeño y busca oportunidades para desarrollar nuevas habilidades y explotar aún más su talento?'),(6,0,2,'Hace un buen uso de mi tiempo y organiza sus prioridades de manera que pueda llevar a cabo todo el trabajo asignado?'),(7,0,2,'Aprovecha sus debilidades para mejorar día con día y demuestra a través deli trabajo y actitud sus avances?'),(8,0,2,'Busca mejorar los procesos, proyectos, tareas asignadas a través de mi contribución dentro de la empresa?'),(9,0,2,'Hace un esfuerzo por cumplir la meta requerida para el nivel de inglés que la empresa me pide?'),(10,0,2,'Trabaja eficientemente y no deja para el \"Miércoles lo que puedo hacer para el Lunes\"?'),(11,0,3,'Trabaja de manera adecuada con cualquier compañero, deja de lado las diferencias y trabaja de forma objetiva?'),(12,0,3,'Aprende de sus errores y está en la búsqueda constante de mejora a nivel laboral e interpersonal? Acepta de manera positiva el feedback constructivo?'),(13,0,3,'Demuestra una actitud receptiva cuando le proponen nuevas ideas, métodos de trabajo?'),(14,0,3,'Se mantiene al tanto de los cambios y nuevas tendencias en la industria digital buscando evolucionar constantemente?'),(15,0,3,'Entiende y acepta con buena actitud los cambios que se dan constantemente en las tareas, proyectos que se me asignan al igual con cambios que se dan a nivel corporativo?'),(16,0,4,'Se enfoco en soluciones cuando identifica debilidades en lugar de criticar y genera un ambiente dañino?'),(17,0,4,'Sale de su \"Zona de Confort\" y busca aportar un valor agregado a todos sus actividades.'),(18,0,4,'Es curios@, ágil, chispa y asume retos en los cambios constantes que le demandan las labores del día a día?'),(19,0,4,'Enfoca su trabajo de una manera estratégica y piensa en lo que es mejor para el cliente y la agencia y no simplemente sigue instrucciones a ciegas?'),(20,0,4,'En momentos donde la carga laboral se reduce, contribuye en el desarrollo de nuevas ideas, proyectos, etc?'),(21,0,5,'Piensa que: \"El éxito… es el éxito de mis equipos de trabajo\"'),(22,0,5,'Mantiene comunicación directa, honesta y profesional con todos los integrantes de sus equipos de trabajo?'),(23,0,5,'Colabora para que exista sinergia, buena vibra, \"no drama\", dentro de sus grupos de trabajo?'),(24,0,5,'Cuando se presenta un reto/algún proyecto ofrezce el apoyo/ayuda para que la tarea y objetivo se cumpla?'),(25,0,5,'Su actitud siempre es conducida a la colaboración?');
/*!40000 ALTER TABLE `question` ENABLE KEYS */;
UNLOCK TABLES;

